            WriteLiteral(@"<script>
    function getInventory(){
        var thang = $(""#chooseMonth"").val();
        var nam = $(""#chooseYear"").val();
        $.ajax({
            url: '/Admin/InventoryReports?month=' + thang + '&year=' + nam,
            type: 'GET',
